      ?person dbo:alumniOf ?almaMater .
      FILTER(CONTAINS(str(?person), "Carl L. Nippert"))
    } AS ?hasAlmaMater)
    ?person dbo:alumniOf ?almaMater .
    FILTER(CONTAINS(str(?person), "Carl L. Nippert"))
  }
  OPTIONAL { 
    BIND(EXISTS{
      ?location dct:subject ?entity .
      FILTER(CONTAINS(str(?location), "Baden-Württemberg"))
    } AS ?hasEntity)
    ?location dct:subject ?entity .
    FILTER(CONTAINS(str(?location), "Baden-Württemberg"))
  }
  OPTIONAL { 
    BIND(EXISTS{
      ?character dbo:alsoKnownAs ?alterEgo .
      FILTER(CONTAINS(str(?character), "Black Hood"))
    } AS ?hasAlterEgo)
    ?character dbo:alsoKnownAs ?alterEgo .
    FILTER(CONTAINS(str(?character), "Black Hood"))
  }
}

