SELECT ?birthPlace ?nottinghamshireEntity ?unitedKingdomEntity
WHERE {
  OPTIONAL { 
    BIND(EXISTS{
      SELECT ?s
      WHERE {
        ?s dbo:birthPlace ?o .
        ?s rdfs:label "Thomas Warner (poet)"@en .
        FILTER(LANGMATCHES(LANG(?s), 'en')) .
      }
    } AS ?hasBirthPlace)
    BIND(IF(?hasBirthPlace, "England", "Unknown") AS ?birthPlace)
  }
  OPTIONAL { 
    BIND(EXISTS{
      SELECT ?s
      WHERE {
        ?s dbo:location ?o .
        ?s rdfs:label ?label .
        FILTER regex(?label, "Nottinghamshire", "i") .
        FILTER(LANGMATCHES(LANG(?s), 'en')) .
      }
    } AS ?hasNottinghamshireEntity)
    BIND(IF(?hasNottinghamshireEntity, "Nottinghamshire", "Unknown") AS ?nottinghamshireEntity)
  }
  OPTIONAL { 
    BIND(EXISTS{
      SELECT ?s
      WHERE {
        ?s dbo:location ?o .
        ?s rdfs:label ?label .
        FILTER regex(?label, "United Kingdom", "i") .
        FILTER(LANGMATCHES(LANG(?s), 'en')) .
      }
    } AS ?hasUnitedKingdomEntity)
    BIND(IF(?hasUnitedKingdomEntity, "United Kingdom", "Unknown") AS ?unitedKingdomEntity)
  }
}

